import React from "react";

function ImagePopup(props) {
	return (
	  <div className={`popup popup_type_image ${props.isOpen ? 'popup_opened' : ''}`}>
		 <figure className="popup__figure">
			<button className="popup__close popup__close-button" type="button" onClick={props.onClose}></button>
			<img className="popup__image" src={props.card.link} alt={props.card.name} />
			<figcaption className="popup__title popup__title_type_image">{props.card.name}</figcaption>
		 </figure>
	  </div>
	);
 }

export default ImagePopup;
